1.  **Căn chỉnh Kim (Pointer):** Thêm `left-1/2 -translate-x-1/2` để đảm bảo kim luôn nằm chính giữa màn hình theo chiều ngang (trước đó có thể bị lệch nhẹ do thiếu thuộc tính này).
2.  **Logic "Tia Chiếu" (Raycast):** Thay vì dùng công thức ngược, tôi sẽ chuyển sang logic "Tia chiếu" xuôi chiều (Forward Kinematics) giống như mô tả của bạn.
    *   Hệ thống sẽ tính toán góc thực tế của từng miếng bánh (Slice) trên màn hình (World Coordinates).
    *   Kiểm tra xem góc 270 độ (Hướng 12 giờ) nằm trong phạm vi của miếng bánh nào.
    *   Logic này đúng bất kể quay chiều nào (cùng chiều hay ngược chiều kim đồng hồ).

