# Updated files:

## components/ConcentricWheel.tsx

- **CSS Pointer:** Thêm `left-1/2 -translate-x-1/2` để kim căn giữa tuyệt đối.
- **Visual:** Thêm một tia laser mờ (`bg-red-500/30`) nối từ kim đến tâm để người chơi dễ dàng xác nhận kết quả (khớp với ý tưởng "tia vô hình").
- **Logic `getWinner`:** Viết lại hoàn toàn. Hàm `getWinner` bây giờ sẽ duyệt qua từng item, tính góc Bắt đầu và Kết thúc thực tế của nó trên màn hình, sau đó kiểm tra xem góc 270 (hướng 12h) có nằm giữa không.

```tsx
import React, { useEffect, useRef, useState, useCallback } from 'react';
import { WheelItem } from '../types';
import { COLD_COLORS, HOT_COLORS, getColor } from '../utils/colors';
import { audioService } from '../services/audio';

interface ConcentricWheelProps {
  outerItems: WheelItem[];
  innerItems: WheelItem[];
  onSpinEnd: (result: { outer: WheelItem; inner: WheelItem }) => void;
  isSpinning: boolean;
  setIsSpinning: (spinning: boolean) => void;
}

const OUTER_SIZE = 800; // ViewBox size
const INNER_SIZE_RATIO = 0.6; // Inner wheel is 60% of outer
const CENTER_BTN_RATIO = 0.15;

// Standardize angles to [0, 360)
const normalizeAngle = (angle: number) => {
  return ((angle % 360) + 360) % 360;
};

const ConcentricWheel: React.FC<ConcentricWheelProps> = ({
  outerItems,
  innerItems,
  onSpinEnd,
  isSpinning,
  setIsSpinning,
}) => {
  // Angles in degrees (Accumulated rotation)
  const [outerAngle, setOuterAngle] = useState(0);
  const [innerAngle, setInnerAngle] = useState(0);

  // Animation refs
  const animFrameRef = useRef<number>(0);
  const velocitiesRef = useRef({ outer: 0, inner: 0 });
  const startTimeRef = useRef<number>(0);
  const totalSpinTimeRef = useRef<number>(0);

  // Sound throttling
  const lastSoundOuterRef = useRef<number>(0);
  const lastSoundInnerRef = useRef<number>(0);

  // --- HELPER FUNCTIONS ---

  const getCoordinatesForPercent = (percent: number, radius: number) => {
    const x = radius * Math.cos(2 * Math.PI * percent);
    const y = radius * Math.sin(2 * Math.PI * percent);
    return [x, y];
  };

  const makeSlicePath = (startPercent: number, endPercent: number, radius: number) => {
    const [startX, startY] = getCoordinatesForPercent(startPercent, radius);
    const [endX, endY] = getCoordinatesForPercent(endPercent, radius);
    const largeArcFlag = endPercent - startPercent > 0.5 ? 1 : 0;

    return [
      `M ${0} ${0}`,
      `L ${startX} ${startY}`,
      `A ${radius} ${radius} 0 ${largeArcFlag} 1 ${endX} ${endY}`,
      `Z`
    ].join(' ');
  };

  // --- SPIN LOGIC ---

  const handleSpinClick = useCallback(() => {
    if (isSpinning || outerItems.length === 0 || innerItems.length === 0) return;

    setIsSpinning(true);

    // Random spin duration: 4s - 7s
    const duration = 4000 + Math.random() * 3000;
    totalSpinTimeRef.current = duration;
    startTimeRef.current = performance.now();

    // Initial velocities (deg/frame)
    // Outer: Clockwise (+), Inner: Counter-Clockwise (-)
    velocitiesRef.current = {
      outer: 25 + Math.random() * 15, 
      inner: -1 * (25 + Math.random() * 15)
    };

    const animate = (time: number) => {
      const elapsed = time - startTimeRef.current;
      const progress = Math.min(elapsed / totalSpinTimeRef.current, 1);

      // Ease out cubic
      const ease = 1 - Math.pow(1 - progress, 3);

      if (progress < 1) {
        // Apply friction
        velocitiesRef.current.outer *= 0.99; 
        velocitiesRef.current.inner *= 0.99;

        setOuterAngle(prev => {
          const next = prev + velocitiesRef.current.outer;
          checkClickSound(prev, next, outerItems.length, lastSoundOuterRef);
          return next;
        });

        setInnerAngle(prev => {
          const next = prev + velocitiesRef.current.inner;
          checkClickSound(prev, next, innerItems.length, lastSoundInnerRef);
          return next;
        });

        // Early stop check if too slow
        if (elapsed > totalSpinTimeRef.current && Math.abs(velocitiesRef.current.outer) < 0.05) {
           finishSpin();
           return;
        }

        animFrameRef.current = requestAnimationFrame(animate);
      } else {
         // Drift phase (very slow finish)
         velocitiesRef.current.outer *= 0.92;
         velocitiesRef.current.inner *= 0.92;

         if (Math.abs(velocitiesRef.current.outer) < 0.01 && Math.abs(velocitiesRef.current.inner) < 0.01) {
           finishSpin();
         } else {
            setOuterAngle(prev => {
              const next = prev + velocitiesRef.current.outer;
              checkClickSound(prev, next, outerItems.length, lastSoundOuterRef);
              return next;
            });
            setInnerAngle(prev => {
              const next = prev + velocitiesRef.current.inner;
              checkClickSound(prev, next, innerItems.length, lastSoundInnerRef);
              return next;
            });
            animFrameRef.current = requestAnimationFrame(animate);
         }
      }
    };

    animFrameRef.current = requestAnimationFrame(animate);
  }, [isSpinning, outerItems, innerItems, setIsSpinning]);

  const checkClickSound = (prevAngle: number, nextAngle: number, itemCount: number, lastSoundRef: React.MutableRefObject<number>) => {
    const sliceSize = 360 / itemCount;
    const prevIndex = Math.floor(prevAngle / sliceSize);
    const nextIndex = Math.floor(nextAngle / sliceSize);

    if (prevIndex !== nextIndex) {
      const now = performance.now();
      // Throttle to max 20 clicks/sec to save ears
      if (now - lastSoundRef.current > 50) { 
        audioService.playTick();
        lastSoundRef.current = now;
      }
    }
  };

  const finishSpin = () => {
    if (animFrameRef.current) cancelAnimationFrame(animFrameRef.current);

    // --- WINNER CALCULATION (Raycast Logic) ---
    // We check what is currently at 270 degrees (12 o'clock in SVG space)
    // SVG Space: 0deg = 3 o'clock. 90deg = 6 o'clock. 180deg = 9 o'clock. 270deg = 12 o'clock.

    const getWinnerByAngle = (currentRotation: number, items: WheelItem[]) => {
      if (items.length === 0) return { id: 'unknown', text: '?' };

      const sliceAngle = 360 / items.length;
      const pointerAngle = 270; // Fixed at Top (12 o'clock)

      // We rotated the wheel container by -90deg visually to start Item 0 at top.
      // Global Rotation = currentRotation - 90.
      const globalRotation = currentRotation - 90;

      // Find the item that contains the pointerAngle
      const index = items.findIndex((_, i) => {
        // Local Start/End of the slice (0 to 360 relative to wheel start)
        const localStart = i * sliceAngle;
        const localEnd = (i + 1) * sliceAngle;

        // Convert to World Angles
        const worldStart = normalizeAngle(localStart + globalRotation);
        const worldEnd = normalizeAngle(localEnd + globalRotation);

        // Check if 270 is between start and end
        if (worldStart < worldEnd) {
          // Normal case (e.g. 10 to 50)
          return pointerAngle >= worldStart && pointerAngle < worldEnd;
        } else {
          // Wrap around case (e.g. 350 to 30)
          return pointerAngle >= worldStart || pointerAngle < worldEnd;
        }
      });

      return index !== -1 ? items[index] : items[0];
    };

    const outerWinner = getWinnerByAngle(outerAngle, outerItems);
    const innerWinner = getWinnerByAngle(innerAngle, innerItems);

    setIsSpinning(false);
    onSpinEnd({ outer: outerWinner, inner: innerWinner });
  };

  // --- RENDER ---

  const renderWheel = (items: WheelItem[], radius: number, colors: string[], rotation: number) => {
    if (items.length === 0) return null;
    const sliceAngle = 1 / items.length; 

    return (
      // Rotate -90 so Item 0 starts at 12 o'clock visually
      <g transform={`rotate(${rotation - 90})`}>
        {items.map((item, index) => {
          const start = index * sliceAngle;
          const end = (index + 1) * sliceAngle;
          const midAngleRad = (start + end) / 2 * 2 * Math.PI;

          const textRadius = radius * 0.75;
          const tx = textRadius * Math.cos(midAngleRad);
          const ty = textRadius * Math.sin(midAngleRad);
          const rotateText = (start + end) / 2 * 360; 

          return (
            <g key={item.id}>
              <path
                d={makeSlicePath(start, end, radius)}
                fill={getColor(index, colors)}
                stroke="white"
                strokeWidth="2"
              />
              <text
                x={tx}
                y={ty}
                fill="white"
                fontSize={items.length > 12 ? 14 : 20}
                fontWeight="bold"
                textAnchor="middle"
                dominantBaseline="middle"
                transform={`rotate(${rotateText}, ${tx}, ${ty})`}
                style={{ pointerEvents: 'none', textShadow: '0px 1px 2px rgba(0,0,0,0.3)' }}
              >
                {items.length > 20 ? (index + 1) : (item.text.length > 15 ? item.text.substring(0, 12) + '...' : item.text)}
              </text>
            </g>
          );
        })}
      </g>
    );
  };

  return (
    <div className="relative w-full h-full flex items-center justify-center select-none overflow-visible">

      {/* The "Invisible Ray" - Visual Aid for the winning line */}
      <div className="absolute top-1/2 left-1/2 w-[2px] h-[50%] bg-red-500/20 -translate-x-1/2 -translate-y-full pointer-events-none z-10 origin-bottom"></div>

      {/* Pointer - Fixed at Top (12 o'clock) */}
      {/* Added left-1/2 -translate-x-1/2 to ensure perfect centering */}
      <div className="absolute top-0 left-1/2 -translate-x-1/2 z-30 drop-shadow-lg pointer-events-none -mt-2">
        <div className="w-0 h-0 border-l-[24px] border-l-transparent border-r-[24px] border-r-transparent border-t-[50px] border-t-red-600 filter drop-shadow-md"></div>
      </div>

      <svg 
        viewBox={`-${OUTER_SIZE/2} -${OUTER_SIZE/2} ${OUTER_SIZE} ${OUTER_SIZE}`} 
        className="w-[95%] max-w-[800px] aspect-square drop-shadow-2xl"
        style={{ overflow: 'visible' }}
      >
        {/* Outer Wheel */}
        {renderWheel(outerItems, OUTER_SIZE/2, COLD_COLORS, outerAngle)}

        {/* Inner Wheel */}
        {renderWheel(innerItems, (OUTER_SIZE/2) * INNER_SIZE_RATIO, HOT_COLORS, innerAngle)}

        {/* Center Button Decoration */}
        <circle cx="0" cy="0" r={(OUTER_SIZE/2) * CENTER_BTN_RATIO + 8} fill="white" opacity="0.3" />
        <circle cx="0" cy="0" r={(OUTER_SIZE/2) * CENTER_BTN_RATIO + 4} fill="rgba(255,255,255,0.8)" />
      </svg>

      {/* Interactive Center Button */}
      <button
        onClick={handleSpinClick}
        disabled={isSpinning || outerItems.length === 0 || innerItems.length === 0}
        className={`absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 z-20 rounded-full bg-gradient-to-br from-rose-500 to-red-700 text-white font-black text-xl md:text-2xl tracking-widest shadow-[0_0_25px_rgba(225,29,72,0.5)] border-4 border-white transition-all active:scale-95 flex items-center justify-center ${isSpinning ? 'cursor-not-allowed opacity-90 scale-95' : 'hover:scale-110 hover:shadow-[0_0_40px_rgba(225,29,72,0.8)]'}`}
        style={{
            width: `${CENTER_BTN_RATIO * 100}%`,
            height: `${CENTER_BTN_RATIO * 100}%`,
            maxWidth: '140px',
            maxHeight: '140px',
            minWidth: '80px',
            minHeight: '80px'
        }}
      >
        {isSpinning ? (
            <div className="animate-spin w-8 h-8 border-4 border-white border-t-transparent rounded-full"></div>
        ) : 'QUAY'}
      </button>
    </div>
  );
};

export default ConcentricWheel;
```

Tôi sẽ cập nhật lại logic tính toán kết quả trong file `components/ConcentricWheel.tsx`.

**Nguyên nhân chưa khớp:**
Cách tính cũ dựa trên việc so sánh khoảng `[start, end]` trong hệ tọa độ toàn cục (World Coordinates) dễ gặp lỗi sai số ở các điểm biên (boundary) và điểm nối vòng tròn (360 độ về 0 độ).

**Giải pháp mới (Chính xác hơn):**
Tôi sẽ chuyển sang phương pháp **"Ánh xạ ngược" (Reverse Mapping)**.
Thay vì hỏi "Miếng bánh đang ở đâu trên màn hình?", ta sẽ hỏi "Cây kim đang nằm ở đâu so với miếng bánh?".
1.  Vị trí kim cố định là 0 độ (hướng 3 giờ).
2.  Góc tương đối của kim so với vòng quay = `0 - Góc_quay_hiện_tại`.
3.  Chỉ cần chia góc tương đối này cho kích thước mỗi miếng bánh (`360 / số_lượng`) và lấy phần nguyên (`Math.floor`) là ra ngay chỉ số (Index) của người trúng thưởng. Cách này triệt tiêu hoàn toàn sai số logic.

