## components/ConcentricWheel.tsx

- Cập nhật hàm `getWinnerByAngle` sử dụng thuật toán ánh xạ ngược (Index = Angle / SliceSize) để đảm bảo độ chính xác tuyệt đối.
- Đảm bảo kim chỉ định nằm ở vị trí 3 giờ (bên phải) và hướng mũi nhọn về tâm.

```tsx
