Việc kết quả không chính xác ("sai số lớn") là do vấn đề đồng bộ hóa trạng thái trong React (State Closure Stale).

Khi vòng quay đang chạy, hàm `finishSpin` được tạo ra từ lúc bắt đầu click và đang "nhớ" giá trị góc quay cũ (lúc chưa quay), thay vì giá trị góc quay mới nhất khi dừng lại. Do đó, dù hình ảnh vòng quay đã dừng ở vị trí mới, nhưng code lại tính toán dựa trên vị trí cũ.

**Cách khắc phục triệt để:**
Tôi sẽ sử dụng `useRef` để lưu trữ giá trị góc quay (`angleRef`). `useRef` hoạt động như một biến toàn cục trong Component, luôn cập nhật giá trị mới nhất ngay lập tức mà không phụ thuộc vào chu kỳ Render của React. Điều này đảm bảo khi hàm tính toán chạy, nó luôn lấy được con số góc quay chính xác tại mili-giây đó.

