Tôi sẽ điều chỉnh lại thuật toán tính toán vị trí và kích thước chữ trong `ConcentricWheel.tsx`.

**Vấn đề:**
Code cũ đặt chữ ở vị trí cố định (`radius * 0.75`) mà không tính toán đến độ rộng thực tế của vòng tròn (Band Width). Điều này khiến chữ ở Vòng Trong (Inner Wheel) dễ bị tràn ra ngoài do bán kính nhỏ hơn nhưng lại dùng công thức giống vòng ngoài.

**Giải pháp khắc phục:**
1.  **Căn giữa chữ vào "Vành đai" (Band Centering):** Tính toán chính xác mép trong và mép ngoài của từng vòng quay để đặt chữ vào chính giữa khoảng không gian đó.
    *   Vòng Ngoài: Nằm giữa bán kính 240px và 400px -> Chữ đặt ở 320px.
    *   Vòng Trong: Nằm giữa bán kính 60px và 240px -> Chữ đặt ở 150px.
2.  **Giới hạn chiều dài chữ (Radial Constraint):** Tính toán không gian chiều ngang tối đa cho phép (`maxRadialWidth`) dựa trên độ rộng vành đai. Nếu chữ dài hơn khoảng này, nó sẽ tự động thu nhỏ font chữ lại để vừa vặn.
3.  **Tối ưu hiển thị:** Điều chỉnh giới hạn ký tự và cỡ chữ tối thiểu để đảm bảo tính thẩm mỹ.

