```tsx
import React, { useEffect, useRef, useState, useCallback } from 'react';
import { WheelItem } from '../types';
import { COLD_COLORS, HOT_COLORS, getColor } from '../utils/colors';
import { audioService } from '../services/audio';

interface ConcentricWheelProps {
  outerItems: WheelItem[];
  innerItems: WheelItem[];
  onSpinEnd: (result: { outer: WheelItem; inner: WheelItem }) => void;
  isSpinning: boolean;
  setIsSpinning: (spinning: boolean) => void;
}

const OUTER_SIZE = 800; // ViewBox size
const INNER_SIZE_RATIO = 0.6; // Inner wheel is 60% of outer
const CENTER_BTN_RATIO = 0.15;

// Standardize angles to [0, 360)
const normalizeAngle = (angle: number) => {
  return ((angle % 360) + 360) % 360;
};

const ConcentricWheel: React.FC<ConcentricWheelProps> = ({
  outerItems,
  innerItems,
  onSpinEnd,
  isSpinning,
  setIsSpinning,
}) => {
  // Display state for rendering
  const [outerAngle, setOuterAngle] = useState(0);
  const [innerAngle, setInnerAngle] = useState(0);

  // Refs for logic (Source of Truth during animation)
  const outerAngleRef = useRef(0);
  const innerAngleRef = useRef(0);

  // Animation refs
  const animFrameRef = useRef<number>(0);
  const velocitiesRef = useRef({ outer: 0, inner: 0 });
  const startTimeRef = useRef<number>(0);
  const totalSpinTimeRef = useRef<number>(0);

  // Sound throttling
  const lastSoundOuterRef = useRef<number>(0);
  const lastSoundInnerRef = useRef<number>(0);

  // --- HELPER FUNCTIONS ---

  const getCoordinatesForPercent = (percent: number, radius: number) => {
    const x = radius * Math.cos(2 * Math.PI * percent);
    const y = radius * Math.sin(2 * Math.PI * percent);
    return [x, y];
  };

  const makeSlicePath = (startPercent: number, endPercent: number, radius: number) => {
    const [startX, startY] = getCoordinatesForPercent(startPercent, radius);
    const [endX, endY] = getCoordinatesForPercent(endPercent, radius);
    const largeArcFlag = endPercent - startPercent > 0.5 ? 1 : 0;

    return [
      `M ${0} ${0}`,
      `L ${startX} ${startY}`,
      `A ${radius} ${radius} 0 ${largeArcFlag} 1 ${endX} ${endY}`,
      `Z`
    ].join(' ');
  };

  // --- SPIN LOGIC ---

  const checkClickSound = (prevAngle: number, nextAngle: number, itemCount: number, lastSoundRef: React.MutableRefObject<number>) => {
    const sliceSize = 360 / itemCount;
    const prevTick = Math.floor(prevAngle / sliceSize);
    const nextTick = Math.floor(nextAngle / sliceSize);

    if (prevTick !== nextTick) {
      const now = performance.now();
      // Throttle to max 20 clicks/sec
      if (now - lastSoundRef.current > 50) { 
        audioService.playTick();
        lastSoundRef.current = now;
      }
    }
  };

  const calculateResult = () => {
    // --- WINNER CALCULATION (Ref-based Logic) ---
    // Use refs (outerAngleRef.current) instead of state (outerAngle) 
    // to ensure we get the LATEST angle when the animation finishes.

    const getWinnerByAngle = (currentRotation: number, items: WheelItem[]) => {
      if (items.length === 0) return { id: 'unknown', text: '?' };

      const sliceAngle = 360 / items.length;

      // Logic:
      // Wheel rotates Clockwise (+).
      // Pointer is at 0 (3 o'clock).
      // To find which slice is under the pointer, calculate pointer's angle relative to wheel.
      // PointerRelative = 0 - WheelRotation.

      const pointerLocalAngle = normalizeAngle(0 - currentRotation);
      const index = Math.floor(pointerLocalAngle / sliceAngle);
      const safeIndex = Math.max(0, Math.min(index, items.length - 1));

      return items[safeIndex];
    };

    // IMPORTANT: Use .current values here!
    const outerWinner = getWinnerByAngle(outerAngleRef.current, outerItems);
    const innerWinner = getWinnerByAngle(innerAngleRef.current, innerItems);

    return { outer: outerWinner, inner: innerWinner };
  };

  const finishSpin = () => {
    if (animFrameRef.current) cancelAnimationFrame(animFrameRef.current);

    const result = calculateResult();
    setIsSpinning(false);
    onSpinEnd(result);
  };

  const handleSpinClick = useCallback(() => {
    if (isSpinning || outerItems.length === 0 || innerItems.length === 0) return;

    setIsSpinning(true);

    const duration = 4000 + Math.random() * 3000;
    totalSpinTimeRef.current = duration;
    startTimeRef.current = performance.now();

    // Velocity: deg/frame
    velocitiesRef.current = {
      outer: 25 + Math.random() * 15, 
      inner: -1 * (25 + Math.random() * 15)
    };

    const animate = (time: number) => {
      const elapsed = time - startTimeRef.current;
      const progress = Math.min(elapsed / totalSpinTimeRef.current, 1);

      // Ease out cubic
      const ease = 1 - Math.pow(1 - progress, 3);

      if (progress < 1) {
        velocitiesRef.current.outer *= 0.99; 
        velocitiesRef.current.inner *= 0.99;

        const prevOuter = outerAngleRef.current;
        const prevInner = innerAngleRef.current;

        // Update Refs directly
        outerAngleRef.current += velocitiesRef.current.outer;
        innerAngleRef.current += velocitiesRef.current.inner;

        // Sound check
        checkClickSound(prevOuter, outerAngleRef.current, outerItems.length, lastSoundOuterRef);
        checkClickSound(prevInner, innerAngleRef.current, innerItems.length, lastSoundInnerRef);

        // Sync State for Render
        setOuterAngle(outerAngleRef.current);
        setInnerAngle(innerAngleRef.current);

        // Stop if extremely slow
        if (elapsed > totalSpinTimeRef.current && Math.abs(velocitiesRef.current.outer) < 0.05) {
           finishSpin();
           return;
        }

        animFrameRef.current = requestAnimationFrame(animate);
      } else {
         // Drift phase
         velocitiesRef.current.outer *= 0.92;
         velocitiesRef.current.inner *= 0.92;

         if (Math.abs(velocitiesRef.current.outer) < 0.01 && Math.abs(velocitiesRef.current.inner) < 0.01) {
           finishSpin();
         } else {
            const prevOuter = outerAngleRef.current;
            const prevInner = innerAngleRef.current;

            outerAngleRef.current += velocitiesRef.current.outer;
            innerAngleRef.current += velocitiesRef.current.inner;

            checkClickSound(prevOuter, outerAngleRef.current, outerItems.length, lastSoundOuterRef);
            checkClickSound(prevInner, innerAngleRef.current, innerItems.length, lastSoundInnerRef);

            setOuterAngle(outerAngleRef.current);
            setInnerAngle(innerAngleRef.current);

            animFrameRef.current = requestAnimationFrame(animate);
         }
      }
    };

    animFrameRef.current = requestAnimationFrame(animate);
  }, [isSpinning, outerItems, innerItems, setIsSpinning]);

  // --- RENDER ---

  const renderWheel = (items: WheelItem[], radius: number, colors: string[], rotation: number) => {
    if (items.length === 0) return null;
    const sliceAngle = 1 / items.length; 

    // --- Dynamic Sizing Logic ---
    // Distinguish between Outer and Inner wheel based on radius size
    // Outer Wheel Radius is typically 400 (OUTER_SIZE/2)
    // Inner Wheel Radius is typically 240 (400 * 0.6)
    const isOuter = radius > 300; 

    // Calculate the "Band" where text can safely live
    // Outer Band: From 240 to 400. Center ~320. Width 160.
    // Inner Band: From 60 (Button) to 240. Center ~150. Width 180.

    const innerBoundary = isOuter ? radius * 0.6 : radius * 0.25; 
    const bandMiddle = (radius + innerBoundary) / 2;
    const bandWidth = radius - innerBoundary;

    // Set text path radius to the middle of the band
    const textPathRadius = bandMiddle;

    // Constraint 1: Tangential Density (Arc Length)
    const circumference = 2 * Math.PI * textPathRadius;
    const arcLength = circumference / items.length;
    const densityFontSize = Math.min(arcLength * 0.45, 30); 

    // Constraint 2: Radial Space (Band Width)
    // We allow text to take up about 85% of the band width
    const maxRadialWidth = bandWidth * 0.85;

    // Calculate base font size
    let baseFontSize = Math.min(densityFontSize, 24);
    baseFontSize = Math.max(10, baseFontSize);

    return (
      <g transform={`rotate(${rotation})`}>
        {items.map((item, index) => {
          const start = index * sliceAngle;
          const end = (index + 1) * sliceAngle;
          const midAngleRad = (start + end) / 2 * 2 * Math.PI;

          const tx = textPathRadius * Math.cos(midAngleRad);
          const ty = textPathRadius * Math.sin(midAngleRad);
          const rotateText = (start + end) / 2 * 360; 

          // --- Per-Item Content Scaling ---
          const showNumber = items.length > 24; 

          let displayText = item.text;
          let itemFontSize = baseFontSize;

          if (showNumber) {
            displayText = (index + 1).toString();
          } else {
            // Text truncation
            const charLimit = 25;
            if (displayText.length > charLimit) {
               displayText = displayText.substring(0, charLimit - 2) + '..';
            }

            // Shrink font for long text to fit Radial Width
            // Estimated text width ~ charCount * 0.55 * fontSize (average aspect ratio)
            const estimatedWidth = displayText.length * (baseFontSize * 0.55);

            if (estimatedWidth > maxRadialWidth) {
               const scale = maxRadialWidth / estimatedWidth;
               // Scale down, min limit 9px
               itemFontSize = Math.max(9, baseFontSize * scale);
            }
          }

          return (
            <g key={item.id}>
              <path
                d={makeSlicePath(start, end, radius)}
                fill={getColor(index, colors)}
                stroke="white"
                strokeWidth="2"
              />
              <text
                x={tx}
                y={ty}
                fill="white"
                fontSize={itemFontSize}
                fontWeight="bold"
                textAnchor="middle"
                dominantBaseline="middle"
                transform={`rotate(${rotateText}, ${tx}, ${ty})`}
                style={{ pointerEvents: 'none', textShadow: '0px 1px 2px rgba(0,0,0,0.3)' }}
              >
                {displayText}
              </text>
            </g>
          );
        })}
      </g>
    );
  };

  return (
    <div className="relative w-full h-full flex items-center justify-center select-none overflow-visible">

      {/* The "Invisible Ray" - From right (pointer) to center */}
      <div className="absolute top-1/2 right-0 w-[50%] h-[2px] bg-red-500/20 pointer-events-none z-10 origin-right"></div>

      {/* Pointer - Fixed at Right (3 o'clock), Pointing Left (Towards Center) */}
      <div className="absolute top-1/2 right-0 -translate-y-1/2 z-30 drop-shadow-lg pointer-events-none -mr-1">
        {/* Triangle pointing Left */}
        <div className="w-0 h-0 border-t-[24px] border-t-transparent border-b-[24px] border-b-transparent border-r-[40px] border-r-red-600 filter drop-shadow-md"></div>
      </div>

      <svg 
        viewBox={`-${OUTER_SIZE/2} -${OUTER_SIZE/2} ${OUTER_SIZE} ${OUTER_SIZE}`} 
        className="w-[95%] max-w-[800px] aspect-square drop-shadow-2xl"
        style={{ overflow: 'visible' }}
      >
        {/* Outer Wheel */}
        {renderWheel(outerItems, OUTER_SIZE/2, COLD_COLORS, outerAngle)}

        {/* Inner Wheel */}
        {renderWheel(innerItems, (OUTER_SIZE/2) * INNER_SIZE_RATIO, HOT_COLORS, innerAngle)}

        {/* Center Button Decoration */}
        <circle cx="0" cy="0" r={(OUTER_SIZE/2) * CENTER_BTN_RATIO + 8} fill="white" opacity="0.3" />
        <circle cx="0" cy="0" r={(OUTER_SIZE/2) * CENTER_BTN_RATIO + 4} fill="rgba(255,255,255,0.8)" />
      </svg>

      {/* Interactive Center Button */}
      <button
        onClick={handleSpinClick}
        disabled={isSpinning || outerItems.length === 0 || innerItems.length === 0}
        className={`absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 z-20 rounded-full bg-gradient-to-br from-rose-500 to-red-700 text-white font-black text-xl md:text-2xl tracking-widest shadow-[0_0_25px_rgba(225,29,72,0.5)] border-4 border-white transition-all active:scale-95 flex items-center justify-center ${isSpinning ? 'cursor-not-allowed opacity-90 scale-95' : 'hover:scale-110 hover:shadow-[0_0_40px_rgba(225,29,72,0.8)]'}`}
        style={{
            width: `${CENTER_BTN_RATIO * 100}%`,
            height: `${CENTER_BTN_RATIO * 100}%`,
            maxWidth: '140px',
            maxHeight: '140px',
            minWidth: '80px',
            minHeight: '80px'
        }}
      >
        {isSpinning ? (
            <div className="animate-spin w-8 h-8 border-4 border-white border-t-transparent rounded-full"></div>
        ) : 'QUAY'}
      </button>
    </div>
  );
};

export default ConcentricWheel;

Được rồi, tôi hiểu ý bạn. Bạn muốn thay đổi chức năng của nút **"Làm Mới / Chơi Lại"** thành tính năng **"Khôi phục danh sách"**.

Thay vì xóa sạch dữ liệu và điền tên mẫu (Nguyễn Văn A...), nút này bây giờ sẽ hoạt động thông minh hơn:
1.  Nếu bạn đã quay và hệ thống đã tự động xóa bớt tên/câu hỏi: Nút bấm sẽ hiện là **"Khôi phục danh sách"**. Khi bấm, nó sẽ trả lại những cái tên đã bị xóa về danh sách để bạn tiếp tục quay.
2.  Nếu chưa có gì bị xóa: Nó vẫn giữ chức năng **"Đặt lại mặc định"** (Reset toàn bộ) như cũ.

Dưới đây là code cập nhật cho `App.tsx` và `components/Controls.tsx`.

