    - Nếu có mục đã xóa: Thực hiện **Khôi phục** (ghép lại vào danh sách hiện tại).
    - Nếu không có mục đã xóa: Thực hiện **Factory Reset** (hỏi người dùng trước khi về mặc định).

```tsx
import React, { useState, useEffect, useMemo } from 'react';
import ConcentricWheel from './components/ConcentricWheel';
import Controls from './components/Controls';
import ResultModal from './components/ResultModal';
import { WheelItem, WheelResult, GameSettings } from './types';
import { audioService } from './services/audio';
import { Menu, X } from 'lucide-react';

const DEFAULT_OUTER = `Nguyễn Văn A
Trần Thị B
Lê Văn C
Phạm Thị D
Hoàng Văn E
Vũ Thị F
Đặng Văn G
Bùi Thị H`;

const DEFAULT_INNER = `Hát một bài
Múa phụ họa
10 điểm
Tràng vỗ tay
Kể chuyện cười
Nhảy lò cò
Bánh snack
Bút bi`;

const App: React.FC = () => {
  // Raw text inputs
  const [outerText, setOuterText] = useState(() => localStorage.getItem('lucky_outer') ?? DEFAULT_OUTER);
  const [innerText, setInnerText] = useState(() => localStorage.getItem('lucky_inner') ?? DEFAULT_INNER);

  // Track deleted items for restoration feature
  const [deletedOuter, setDeletedOuter] = useState<string[]>([]);
  const [deletedInner, setDeletedInner] = useState<string[]>([]);

  // Parsed items
  const outerItems: WheelItem[] = useMemo(() => 
    outerText.split('\n').map(t => t.trim()).filter(Boolean).map(t => ({ id: t, text: t })), 
  [outerText]);

  const innerItems: WheelItem[] = useMemo(() => 
    innerText.split('\n').map(t => t.trim()).filter(Boolean).map(t => ({ id: t, text: t })), 
  [innerText]);

  // State
  const [isSpinning, setIsSpinning] = useState(false);
  const [result, setResult] = useState<WheelResult | null>(null);

  // Initialize settings with safe defaults for new properties
  const [settings, setSettings] = useState<GameSettings>(() => {
    const saved = localStorage.getItem('lucky_settings');
    const defaults = { removeWinner: false, removeQuestion: false, soundEnabled: true };

    if (saved) {
      try {
        return { ...defaults, ...JSON.parse(saved) };
      } catch (e) {
        return defaults;
      }
    }
    return defaults;
  });

  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  // Persistence
  useEffect(() => {
    localStorage.setItem('lucky_outer', outerText);
  }, [outerText]);

  useEffect(() => {
    localStorage.setItem('lucky_inner', innerText);
  }, [innerText]);

  useEffect(() => {
    localStorage.setItem('lucky_settings', JSON.stringify(settings));
    audioService.setEnabled(settings.soundEnabled);
  }, [settings]);

  // Handlers
  const handleSpinEnd = (res: { outer: WheelItem; inner: WheelItem }) => {
    setResult({ outer: res.outer.text, inner: res.inner.text });
  };

  const handleCloseModal = () => {
    if (result) {
      // Xử lý xóa tên học sinh nếu được bật
      if (settings.removeWinner) {
        setDeletedOuter(prev => [...prev, result.outer]); // Lưu vào danh sách đã xóa
        const newOuterText = outerItems
          .filter(item => item.text !== result.outer)
          .map(item => item.text)
          .join('\n');
        setOuterText(newOuterText);
      }

      // Xử lý xóa câu hỏi/quà nếu được bật
      if (settings.removeQuestion) {
        setDeletedInner(prev => [...prev, result.inner]); // Lưu vào danh sách đã xóa
        const newInnerText = innerItems
          .filter(item => item.text !== result.inner)
          .map(item => item.text)
          .join('\n');
        setInnerText(newInnerText);
      }
    }
    setResult(null);
  };

  const handleReset = () => {
    // Chế độ 1: Khôi phục danh sách đã xóa
    if (deletedOuter.length > 0 || deletedInner.length > 0) {
        if (window.confirm(`Bạn có muốn khôi phục ${deletedOuter.length + deletedInner.length} mục đã bị xóa không?`)) {
            if (deletedOuter.length > 0) {
                setOuterText(prev => {
                    const current = prev.trim();
                    return current ? current + '\n' + deletedOuter.join('\n') : deletedOuter.join('\n');
                });
                setDeletedOuter([]);
            }
            if (deletedInner.length > 0) {
                setInnerText(prev => {
                    const current = prev.trim();
                    return current ? current + '\n' + deletedInner.join('\n') : deletedInner.join('\n');
                });
                setDeletedInner([]);
            }
        }
        return;
    }

    // Chế độ 2: Reset về mặc định ban đầu
    if(window.confirm("Bạn có chắc muốn xóa toàn bộ và quay về dữ liệu mẫu ban đầu? (Dữ liệu hiện tại sẽ mất)")) {
        setOuterText(DEFAULT_OUTER);
        setInnerText(DEFAULT_INNER);
        setDeletedOuter([]);
        setDeletedInner([]);
    }
  };

  const hasDeletedItems = deletedOuter.length > 0 || deletedInner.length > 0;

  return (
    <div className="h-screen w-full flex flex-col md:flex-row overflow-hidden bg-[url('https://images.unsplash.com/photo-1557683316-973673baf926?q=80&w=2029&auto=format&fit=crop')] bg-cover bg-center">
      {/* Mobile Header/Toggle */}
      <div className="md:hidden p-4 flex justify-between items-center bg-white/90 backdrop-blur-sm shadow-md z-40">
        <h1 className="font-extrabold text-xl text-indigo-700">Vòng Quay Kép</h1>
        <button onClick={() => setIsSidebarOpen(!isSidebarOpen)} className="p-2 rounded-md bg-indigo-100 text-indigo-700">
            {isSidebarOpen ? <X /> : <Menu />}
        </button>
      </div>

      {/* Sidebar / Controls */}
      <div className={`
        fixed md:relative z-40 inset-y-0 left-0 w-[350px] transform transition-transform duration-300 ease-in-out shadow-2xl md:shadow-none
        ${isSidebarOpen ? 'translate-x-0' : '-translate-x-full md:translate-x-0'}
      `}>
        <Controls
          outerText={outerText}
          setOuterText={setOuterText}
          innerText={innerText}
          setInnerText={setInnerText}
          settings={settings}
          setSettings={setSettings}
          onReset={handleReset}
          hasDeletedItems={hasDeletedItems}
        />
      </div>

      {/* Backdrop for mobile sidebar */}
      {isSidebarOpen && (
        <div 
            className="fixed inset-0 bg-black/50 z-30 md:hidden"
            onClick={() => setIsSidebarOpen(false)}
        ></div>
      )}

      {/* Main Area (Wheel) */}
      <main className="flex-1 relative flex items-center justify-center p-4 overflow-hidden bg-white/30 md:bg-transparent backdrop-blur-sm md:backdrop-blur-none">
        <div className="w-full max-w-[90vh] aspect-square relative animate-fade-in-up">
          <ConcentricWheel
            outerItems={outerItems}
            innerItems={innerItems}
            onSpinEnd={handleSpinEnd}
            isSpinning={isSpinning}
            setIsSpinning={setIsSpinning}
          />
        </div>
      </main>

      {/* Result Modal */}
      <ResultModal result={result} onClose={handleCloseModal} />

      <style>{`
        @keyframes fade-in-up {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
        }
        .animate-fade-in-up {
            animation: fade-in-up 0.8s ease-out;
        }
      `}</style>
    </div>
  );
};

export default App;
