Nguyên nhân chính khiến chức năng "Khôi phục danh sách" hoạt động không hiệu quả (hoặc dường như không hoạt động) là do **danh sách các mục đã xóa (`deletedOuter`, `deletedInner`) chưa được lưu vào LocalStorage**.

Điều này dẫn đến tình huống:
1. Bạn quay và xóa bớt tên học sinh/câu hỏi.
